import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';

import './Header.scss';
import '../Menu/Menu';

export const Header = props => {
  return (
    <header>
      <div class="jumbotron">
        <div class="container text-center">
          <h1>My Awsome Website</h1>
        </div>
      </div>
      <Menu></Menu>
    </header>
  );
}

export default Header
